B.D3=A.a(s(["\u0130li\u015fkilerinde son derece k\u0131skan\xe7t\u0131r. Sevdi\u011fini kimseyle payla\u015fmak istemez. Fakat kendine kur yapacak birden fazla fl\xf6rt\xfc olabilir. Bir anda a\u015f\u0131k olur bir anda vazge\xe7ebilir. U\u011fruna \xf6zg\xfcrl\xfc\u011f\xfcn\xfc feda edebilece\u011fi \xe7ok az ki\u015fi vard\u0131r. Tutkular\u0131 derin hisleri i\xe7tendir. Ko\xe7lar sevgiye \xe7ok \xf6nem verir. \xc7ok be\u011fenilen bir ki\u015fi olsa bile, kendisine g\xfcvenmez. Hep kusurlar\u0131 oldu\u011funu d\xfc\u015f\xfcn\xfcr ve ya\u015fam\u0131 kendisine zindan eder.","Ger\xe7ek anlamda bu di\u015fi k\u0131z\u0131m\u0131za hangi erkek cesurca yakla\u015f\u0131r merek ediyoruz. Sizin i\xe7in a\u015fk ger\xe7ek bir duygudur.. \u0130nat\xe7\u0131 ve ba\u011fnaz y\xf6nleriniz bir\xe7ok erke\u011fi pes ettirecek g\xfc\xe7tedir. G\xfczel ve \xf6zel yap\u0131n\u0131z,farkl\u0131 bir karizmaya sahip havan\u0131zla her erke\u011fin ba\u015f\u0131n\u0131 d\xf6nd\xfcr\xfcrs\xfcn\xfcz.. Daha k\xfc\xe7\xfck ya\u015flarda A\u015eK sanat\u0131 \xe7\xf6zm\xfc\u015f bir hava i\xe7inde gezerken, \xe7evrenizdeki bir \xe7ok ki\u015fi sizi \xe7ok erken fark ederler.. Kom\u015fu \xe7ocuklar\u0131n\u0131n b\xfcy\xfcd\xfckleri zaman evlenmeyi hayal ettikleri bir sembol olmak bilmem ne kadar ho\u015funuza gidiyor.. Y\u0131llar sonra gen\xe7lik itiraflar\u0131nda, dudaklar\u0131n\u0131 u\xe7uklatacak hikayeler dinlerken utanma ve gururlanma duygular\u0131 i\xe7inde gel gitler ya\u015fayacaks\u0131n\u0131z ve bu b\xfcy\xfck a\u015fklar\u0131n kahraman\u0131 olmak sizi olduk\xe7a mutlu edecektir.. Cinselli\u011finizi \xe7ok \xe7abuk ke\u015ffedeceksiniz.","A\u015fkta \xf6nce mant\u0131k desen de, k\u0131sa ve ho\u015f a\u015fklara hay\u0131r demek istemezsin. Fazla duygusall\u0131k size ho\u015f gelmeyebilir. Olduk\xe7a sosyal yap\u0131nla \xe7evren daima kalabal\u0131kt\u0131r ve a\u015fks\u0131z kalman m\xfcmk\xfcn de\u011fildir. Kar\u015f\u0131ndaki ki\u015fiyi s\xfcrekli \u015fa\u015f\u0131rtt\u0131\u011f\u0131n i\xe7in, \xe7o\u011fu kez, partnerler seninle ilgili duygular\u0131nda zorlan\u0131rlar. Bir ki\u015fiye ba\u011flanmak sizin i\xe7in \xe7ok zor oldu\u011fu i\xe7in, kalpsizlikle su\xe7lanabilirsiniz. Aniden a\u015f\u0131k olur ve \xe7ok \xe7abuk b\u0131kars\u0131n. Bir ki\u015fiye ba\u011flanman\u0131z \xe7ok zordur. S\xfcrekli plan program yapars\u0131n. \xdcstelik bu planlar\u0131 yaparken, kar\u015f\u0131 tarafa asla sezdirmeyecek kadar da, ak\u0131ll\u0131s\u0131n. Seninle birlikte olacak ki\u015filerin asla seni ele\u015ftirmemeleri gerekiyor. Azarlanmaktan ve de\u011fer verilmemekten nefret edersin.. En ula\u015f\u0131lmaz ki\u015fileri bile kendine kolayca ba\u011flars\u0131n.","Sevgi dolu ve sahiplenicisin. A\u015f\u0131k oldu\u011fun zaman hi\xe7 kimseyi g\xf6z\xfcn g\xf6rmez, k\u0131r\u0131lmaktan ve g\xfccenmekten korkars\u0131n. Sevdi\u011fin ki\u015fi seninle konu\u015furken s\xf6zlerine \xe7ok dikkat etmek zorundad\u0131r. A\u015fk senin i\xe7in ya\u015fam\u0131n en \xf6nemli duygusudur.. Be\u011fendi\u011fin biri kar\u015f\u0131na \xe7\u0131kt\u0131\u011f\u0131 zaman hemen harekete ge\xe7mez, kar\u015f\u0131 taraf\u0131n seninle ilgilenmesini istersin. Uzun zaman b\u0131kmadan sevdi\u011fin ki\u015finin duygular\u0131n\u0131 a\xe7\u0131klamas\u0131n\u0131 beklersin. Platonik a\u015fklar\u0131n kahraman\u0131 olmak bilmem sana ne kazand\u0131r\u0131r. Sen uzun vadeli a\u015fklar\u0131n ki\u015fisi oldu\u011fun i\xe7in kar\u015f\u0131na \xe7\u0131kan ki\u015finin k\u0131sa fl\xf6rt duygular\u0131 seni k\u0131rar ve yaralar. Gizli g\xf6zya\u015flar\u0131n\u0131 belki onlar g\xf6rmeyecektir ama geceler boyu a\u011flad\u0131\u011f\u0131n yast\u0131klar\u0131n say\u0131s\u0131n\u0131 y\u0131llarca unutmayacaks\u0131n. An\u0131lar\u0131nda neler yoktur ki? Kurutulmu\u015f \xe7i\xe7ekler, ilk sinema biletleriniz, ilk telefon mesajlar\u0131, birlikte gitti\u011finiz yerlerin k\xfc\xe7\xfck an\u0131lar\u0131, onunla ilk bulu\u015ftu\u011funuz g\xfcn kulland\u0131\u011f\u0131n parf\xfcm daha neler neler.","\xd6zg\xfcrl\xfc\u011f\xfcne d\xfc\u015fk\xfcn ve ba\u015f\u0131nda g\xf6r\xfcnmeyen bir ta\xe7la dola\u015f\u0131rs\u0131n. K\u0131skan\xe7 oldu\u011fun halde, kendin k\u0131skan\xe7l\u0131\u011fa dayanamazs\u0131n\u0131z. Ya\u015fama \xe7ok ba\u011fl\u0131 oldu\u011fun i\xe7in e\u011flenceli ve ak\u0131ll\u0131 erkelerden ho\u015flan\u0131rs\u0131n. A\u015fk konusunda ayaklar\u0131n hep yerdedir. Gezmeyi ve e\u011flenmeyi seversin ama asla u\xe7ar\u0131 bir k\u0131z de\u011filsin. Aldat\u0131lma konusunda son derece duyarl\u0131s\u0131n ve affetme \xf6zelli\u011fin asla yoktur. Duygular\u0131n\u0131 iyi kontrol edersin. Sana kar\u015f\u0131 art niyetsiz sevgi g\xf6sterildi\u011fi zaman, sende ayn\u0131 \u015fekilde davran\u0131rs\u0131n. Do\u011fal bir asalete sahipsin. Affedici \xf6zelli\u011fin yo\u011fun duygular\u0131ndan dolay\u0131 k\u0131s\u0131tl\u0131d\u0131r. Ya\u015fam\u0131n do\u011fru k\u0131zlar\u0131 oldu\u011fun i\xe7in, a\u015fk hayat\u0131nda ikili davran\u0131\u015f bi\xe7imlerine kar\u015f\u0131s\u0131n ve kar\u015f\u0131ndaki ki\u015finin yalan\u0131n\u0131 \xe7abuk g\xf6r\xfcrs\xfcn. Seninle ya\u015famak zor, ayn\u0131 zamanda kolayd\u0131r.","Mant\u0131k ve duygu karma\u015fas\u0131 ya\u015fad\u0131klar\u0131 i\xe7in, s\xfcrekli d\xfczen aray\u0131\u015f\u0131 i\xe7indedirler. Ya\u015famlar\u0131nda ger\xe7ek a\u015fk\u0131n sadece mant\u0131k s\xfczgecinden ge\xe7ti\u011fine inand\u0131klar\u0131 i\xe7in, isteklerine kavu\u015fmak i\xe7in idealleri i\xe7in ya\u015farlar. \u0130stemeseler de \xf6n yarg\u0131l\u0131 olmaktan kendilerini alamazlar. Birlikte oldu\u011fu ki\u015fi s\xfcrekli m\xfckemmel g\xf6rmek istedikleri i\xe7in, partnerlerini tenkitleriyle ya\u015famlar\u0131ndan bezdirebilirler. Y\xfcksek standartlar\u0131 zamanla kendileriniz de rahats\u0131z eder. \xc7ok ge\xe7 ya\u015flarda evlenen bir \xe7ok m\xfczmin bekar Ba\u015fak bulman\u0131z m\xfcmk\xfcnd\xfcr. Kendilerini kolay teslim edemezler. Ya\u015fam\u0131 sorgulamaktan vazge\xe7medikleri m\xfcddet\xe7e duygular\u0131nda \xf6n yarg\u0131l\u0131 olmaya devam ettikleri m\xfcddet\xe7e a\u015fklar\u0131n\u0131 zor ya\u015fayacaklard\u0131r. Ya\u015fam\u0131 ve a\u015fk\u0131 sorgulamaktan vazge\xe7melisiniz. Duygular\u0131n\u0131z\u0131n sizi yan\u0131ltabilece\u011fi ku\u015fkular\u0131na art\u0131k son vermeli, \xf6n yarg\u0131l\u0131 davranman\u0131n yanl\u0131\u015flar\u0131n\u0131 g\xf6rmelisiniz. A\u015fk\u0131n k\xfc\xe7\xfck detaylar\u0131 yerine, size sunulan g\xfczelliklerini ya\u015famal\u0131s\u0131n\u0131z.","Hi\xe7 ku\u015fkusuz m\xfckemmel bir a\u015f\u0131ks\u0131n\u0131z. A\u015fk\u0131 yaratan Ven\xfcs \xf6nce sizi yaratm\u0131\u015f. Sevgi aray\u0131\u015flar\u0131n\u0131z hi\xe7 bitmedi\u011fi i\xe7in de, dengeleriniz s\xfcrekli hassast\u0131r. Bazen a\u015fks\u0131z ya\u015fama korkusu y\xfcz\xfcnden, kendinizi yanl\u0131\u015f ili\u015fkiler i\xe7inde bulabilirsiniz. Evlilik ve a\u015fk i\xe7in yarat\u0131lm\u0131\u015fs\u0131n\u0131z. A\u015fkta duygusall\u0131k ve mant\u0131\u011f\u0131 bir arada ya\u015fars\u0131n\u0131z. A\u015fk sanat\u0131n\u0131 en iyi bilen mitolojinin \xf6zel insanlar\u0131n\u0131z. Ayr\u0131l\u0131klarda \xe7abuk toparlan\u0131rs\u0131n\u0131z. \xc7\xfcnk\xfc \xe7evreniz sizi be\u011fenen bir dolu insanla \xe7evrilidir. A\u015fka a\u015f\u0131ks\u0131n\u0131z.","Bur\xe7lar ku\u015fa\u011f\u0131n\u0131n en gizemli ki\u015fisi olan Akrepler, ya\u015fam\u0131 hi\xe7te hafife almaz. \u0130\xe7lerindeki y\xfcksek duygular\u0131 onlar\u0131 ihtirasl\u0131 ve gizemli yapar. Cinsel duygular\u0131n\u0131 \xe7ok yo\u011fun ya\u015farlar.A\u015fk ya\u015fant\u0131lar\u0131 olduk\xe7a gizlidir. Kolay kap\u0131lar\u0131n\u0131 kimseye a\xe7mazlar.\u0130nsan\u0131 m\u0131knat\u0131s gibi \xe7eken bak\u0131\u015flar\u0131 vard\u0131r. Kar\u015f\u0131s\u0131ndaki ki\u015fi \xe7ok kolay etkileri alt\u0131na al\u0131rlar.Bir ili\u015fkiyi v\xfccutlar\u0131nda ve kalplerinde ayn\u0131 anda ya\u015farlar.Bildikleri tek \u015fey vard\u0131r. G\xfc\xe7l\xfc ihtiraslar\u0131 ve a\u015fka olan inan\xe7lar\u0131d\u0131r. Yasaklar\u0131 delen m\xfcthi\u015f bir sevgilidirler. Bir Akreple beraberlik \xf6nce sab\u0131rdan ge\xe7er.Birine a\u015f\u0131k olmalar\u0131 kolay olmaz..\u0130ncinmekten \xe7ok korkarlar ve kendinizi a\u015fka teslim etmek istemezler.","Olduk\xe7a macerac\u0131 bir yap\u0131ya sahip olan yay burcu a\u015fk hayat\u0131nda da bu tutkusunu s\xfcrd\xfcr\xfcr. Yay burcu a\u015fk hayat\u0131nda partneri ile s\xfcrekli gezmek ve yeni yerler ke\u015ffetmek ister. K\xfc\xe7\xfck seyahatler bile onu heyecanland\u0131rmaya yetecektir. Yay burcu a\u015fk hayat\u0131nda, uzun s\xfcreli bir ili\u015fki i\xe7inde bile olsa, heyecan pe\u015findedir.","Duygular\u0131n\u0131 ne kadar kontrol alt\u0131nda tutsan da, sevgi dolu bir yap\u0131n var. A\u015fk\u0131n zaman i\xe7inde olgunla\u015facak ve co\u015facakt\u0131r. Zor bir k\u0131zs\u0131n. Senin kalbine girmek o kadar kolay de\u011fildir. \u0130lk g\xf6r\xfc\u015fte a\u015f\u0131k olanlardan de\u011filsin. \xdcstelik \xe7ok zor be\u011fenirsin. Kriterlerin \xe7ok y\xfcksektir. Ya\u015fama \xe7ok farkl\u0131 bakars\u0131n. \xc7ocuksu erkeklere tahamm\xfcl\xfcn yoktur. Seni kazanacak ki\u015finin \xf6ncelikle olgun olmas\u0131 gerekiyor. \u0130steklerini her ne kadar dile getirmek istemesen de, hep \xfcst d\xfczeyde bir a\u015fk\u0131n hayalini kurars\u0131n. O\u011flaklar\u0131n genelde a\u015fklar\u0131n ya\u015f fark\u0131 fazlad\u0131r. Kar\u015f\u0131s\u0131ndaki ki\u015filerin tarz\u0131na hayran olduklar\u0131 i\xe7in, a\u015fk\u0131 da sayg\u0131 \xe7er\xe7evesi i\xe7inde ya\u015famak isterler.","Bir a\u015fka ba\u015flamak istedi\u011finde; duygular\u0131n\u0131 saklar ve elde edilmesi zor bir ki\u015fiyi oynars\u0131n. Kar\u015f\u0131ndaki ki\u015fiyi zorlamaktan ho\u015flan\u0131rs\u0131n. Gereksiz samimiyetten ho\u015flanmazs\u0131n. Kar\u015f\u0131ndaki ki\u015finin d\u0131\u015f g\xf6r\xfcn\xfc\u015f\xfc \xf6nemli de\u011fildir. A\u015fkta ileti\u015fi korkusu ya\u015fad\u0131\u011f\u0131n i\xe7in, a\u015fka kolay teslim olmazs\u0131n. Bazen korkakl\u0131kla su\xe7lanabilirsin. \u0130leti\u015fim korkusu y\xfcz\xfcnden kendini s\xfcrekli geriye \xe7ekersin. Ya\u015fam\u0131n\u0131 biriyle payla\u015fma acelen yoktur. \xd6zg\xfcrl\xfck ve anlay\u0131\u015f senin i\xe7in her \u015feyden \xf6nemlidir. Kar\u015f\u0131ndaki ki\u015finin zeki olmas\u0131 ve onunla fikir jimnasti\u011fi yapmas\u0131 gerekir. Ciddi bir \u015fekilde manyetik bir g\xfcce sahipsin. Kalabal\u0131k ortamlarda bile fark edilirsin. Kendine has garip bir ihtiras\u0131n vard\u0131r. \u0130li\u015fkin fazla ciddile\u015fti\u011fi zaman, hemen kendini geriye \xe7ekersin. Fazla samimiyet seni korkutur. Do\u011fru zaman ve do\u011fru partneri bulmak senin i\xe7in \xe7ok \xf6nemlidir. \u0130\u015fte o zaman, kalbinin t\xfcm kap\u0131lar\u0131n\u0131 a\xe7ars\u0131n. Bunun \xe7ok kolay olmayaca\u011f\u0131n\u0131 bildi\u011fin i\xe7in \xe7o\u011fu zaman gizli pi\u015fmanl\u0131klar\u0131n vard\u0131r.","G\xfczel ve her iki cins de bak\u0131ml\u0131 oldu\u011funuz i\xe7in, \xe7evrenizde sizi be\u011fenen binlerce ki\u015fi vard\u0131r. Genelde narin bir yap\u0131n oldu\u011fu i\xe7in \xe7ok \xe7abuk incinirsin. Y\xfcz ifaden durgun ve sakin oldu\u011fu i\xe7in, kar\u015f\u0131ndaki ki\u015fiye huzur verirsin. Fakat garip bir y\xf6n\xfcn vard\u0131r, \xe7ok mutlu g\xf6r\xfcnd\xfc\u011f\xfcn anlarda bile an\u0131nda \xfcz\xfclebilirsin. Seni d\u0131\u015f d\xfcnyan\u0131n sorunlar\u0131ndan koruyacak ger\xe7ek bir a\u015fka ihtiya\xe7 duyars\u0131n. Duygular\u0131n\u0131 payla\u015facak birilerinin olmas\u0131 \xe7ok \xf6nemlidir. Hep imkans\u0131z a\u015fklar\u0131 kendine \xe7ekersin. \u0130\xe7inde saklad\u0131\u011f\u0131n \xf6zel duygular\u0131n\u0131 hi\xe7 kimseyle payla\u015fmak istemedi\u011fin i\xe7in, y\u0131llar sonra anlatt\u0131\u011f\u0131n platonik a\u015fk hikayelerini, \u015fa\u015fk\u0131nl\u0131k i\xe7inde dinleyenler, b\xf6yle duygular\u0131n ya\u015fanm\u0131\u015f olaca\u011f\u0131na inanamazlar. Her t\xfcrl\xfc ac\u0131y\u0131 g\xfcler y\xfczle kar\u015f\u0131layan sana nas\u0131l bir takdir kazand\u0131racak? Kendine sorman gereken \xe7ok soru var."]),t.s)
