B.Dz=A.a(s(["Bu ki\u015filer olduk\xe7a \xe7ekici ve etkileyicidirler. Otoriterdirler. \u0130stekleri ger\xe7ekle\u015ftirme konusunda engel tan\u0131mazlar. Ayn\u0131 zamanda c\xfcretkard\u0131rlar. Kar\u015f\u0131 taraf\u0131 avlamas\u0131 gereken bir av olarak g\xf6r\xfcrler. Bir Ko\xe7\u2019la ili\u015fki ya\u015famak o kadar kolay de\u011fildir. E\u011fer uzun s\xfcreli bir beraberlik planl\u0131yorsan\u0131z, her an her \u015feye haz\u0131r olmal\u0131s\u0131n\u0131z. Heyecanl\u0131 ve meydan okuyan bir ki\u015filikleri vard\u0131r.Ya\u015famlar\u0131nda ikinci olmaktan nefret ettikleri i\xe7in de, beraberliklerine kendi damgalar\u0131n\u0131 vuran Ko\xe7\u2019lar\u0131n yan\u0131nda olmak bile ba\u015fl\u0131 ba\u015f\u0131na bir olayd\u0131r. Birlikte olduklar\u0131 ki\u015fiyi nefessiz b\u0131rakacak kadar hareketlidirler. Disipline gelemeyen ara\u015ft\u0131rmac\u0131 ruhlar\u0131n\u0131n derinliklerinde, onlara e\u015flik edecek bir sevgiliye gereksinim duyarlar ve ya\u015famlar\u0131nda duygular\u0131yla yar\u0131\u015f\u0131rlar. Ba\u011f\u0131ms\u0131z ki\u015filiklerinin s\xfcrekli sevgi ile beslenmeye ihtiya\xe7lar\u0131 vard\u0131r. A\u015fkta zafere ula\u015fmak isterler. Daha gen\xe7 ya\u015flarda kafas\u0131ndaki ki\u015finin tipi ve ki\u015fili\u011fini \u015fekillendirmi\u015ftir. K\u0131skan\xe7l\u0131k, onun duygular\u0131n\u0131 besleyece\u011fi i\xe7in, bu \xf6zelliklerinden s\u0131yr\u0131lmalar\u0131n\u0131 beklememelisiniz. Gururludur ve k\u0131r\u0131ld\u0131\u011f\u0131 zaman kolay affetmez. S\xfcrekli \xf6vg\xfcye ve takdir edilmeye ihtiya\xe7 duyarlar.","Ciddi ve sakin yap\u0131lar\u0131 ile, iyi bir aile reisi olmaya adayd\u0131rlar. Son derece sab\u0131rl\u0131, pratik ve \xe7\xf6z\xfcmleyicidirler. Do\u011fu\u015ftan baba \xf6zelliklerine sahip olduklar\u0131 i\xe7in muhakkak baba olmalar\u0131 gerekmez. \xc7evresindeki her \xe7ocu\u011fa ger\xe7ek bir \u015fevkat g\xf6sterir. Y\xfcksek standartta ya\u015fad\u0131klar\u0131 i\xe7in, konforlu bir hayata hi\xe7bir zaman \u201chay\u0131r\u201d demezler. En b\xfcy\xfck ama\xe7lar\u0131; sevdikleri ile birlikte, duygu dolu anlar ya\u015famalar\u0131d\u0131r. K\xf6klerine \xe7ok ba\u011fl\u0131 olan bu ki\u015filer, \xf6m\xfcr boyu ya\u015fl\u0131 akrabalar\u0131n\u0131n her t\xfcrl\xfc sorunlar\u0131na ko\u015farlar. Ya\u015fam\u0131n temel ta\u015flar\u0131 olduklar\u0131 i\xe7in de ne zaman ba\u015f\u0131 s\u0131k\u0131\u015fan bir dostu varsa o her zaman ordad\u0131r. Onlara \xf6zel g\xfcnlerinde, \xe7ok sevdikleri bir kitap, deri bir c\xfczdan, elektronik oyunlar, onlar\u0131 rahat ettirecek aksesuar niteli\u011finde e\u015fyalar, \xf6rne\u011fin; bir ku\u015f t\xfcy\xfc yast\u0131k alabilirsiniz.","Hareketli ve de\u011fi\u015fken yap\u0131lar\u0131yla dikkat \xe7ekmemeleri m\xfcmk\xfcn de\u011fildir.Sonsuz bir \xf6\u011frenme iste\u011fi i\xe7inde olduklar\u0131 i\xe7in \xe7evrelerine asla kay\u0131ts\u0131z kalmalar\u0131 m\xfcmk\xfcn de\u011fildir. Etraf\u0131n\u0131zda her an e\u011flenceli bir \u0130kizler g\xf6rmeniz m\xfcmk\xfcnd\xfcr. A\u015fk ya\u015fant\u0131lar\u0131 daima bir soru i\u015fareti olup, kendisi dahil hi\xe7 kimse onun ne yapt\u0131\u011f\u0131 konusunda belli bir fikri yoktur. Ya\u015fam boyunca \xe7evresini sorgulamaktan vazge\xe7meyen bu ilgin\xe7 ki\u015filerin pe\u015fine tak\u0131ld\u0131\u011f\u0131n\u0131z zaman asla s\u0131k\u0131lmaz hatta fazlas\u0131yla e\u011flenebilirsiniz. Bir \u0130kizler babas\u0131 d\xfcnyan\u0131n en tatl\u0131 ki\u015fisidir. \xc7ocuklar\u0131 i\xe7in inan\u0131lmaz zevkli bir oyun arkada\u015f\u0131d\u0131r. \xc7ocuklar\u0131 b\xfcy\xfcd\xfckleri zaman bile onlara arkada\u015f muamelesi yaparlar. S\xfcrekli babalar\u0131 ile beraber olmak isteyen \xe7ocuklar\u0131 , onu her zaman yanlar\u0131nda bulamayabilirler, \xc7\xfcnk\xfc s\xfcrekli seyahat etmekten ho\u015flan\u0131rlar. . Bug\xfcn ona en \xe7\u0131lg\u0131n hediyeleri alabilirsiniz. Orijinal spor ayakkab\u0131lar, kaliteli bir g\xfcne\u015f g\xf6zl\xfc\u011f\xfc, renkli ti\u015f\xf6rtler, bluejeanler ve bir seyahat \xe7antas\u0131na hay\u0131r demez.","Sakin ve dengeli yap\u0131lar\u0131 onlar\u0131 bulunduklar\u0131 ortam\u0131n en sevilen ki\u015fisi haline getirir. Duygular\u0131n\u0131 \xe7ok derin ya\u015fad\u0131klar\u0131 i\xe7in, gizemli bir tablo i\xe7inde ya\u015farlar. Sevilen ve aran\u0131lan insanlard\u0131r. Bulunduklar\u0131 ortam\u0131n \u015fartlar\u0131na \xe7ok \xe7abuk uyum sa\u011flad\u0131klar\u0131 i\xe7in, asla \u015fikayet etmezler ve edenlerden de ho\u015flanmazlar.Aile kavram\u0131 \xe7ok fazlad\u0131r. \u0130yi bir baba ve iyi bir e\u015ftir. \xc7ocuklar\u0131na d\xfc\u015fk\xfcn olduklar\u0131 i\xe7in, koruma i\xe7g\xfcd\xfcleri her zaman ataktad\u0131r. Al\u0131ngan olduklar\u0131 i\xe7in de k\u0131r\u0131ld\u0131klar\u0131 zaman kap\u0131lar\u0131n\u0131 \xe7ok \xe7abuk \xe7evrelerine kapat\u0131rlar. \xc7eversine hep yaral\u0131 olmak istedikleri i\xe7in de \xe7o\u011fu kez yanl\u0131\u015f bir \u015fekilde kullan\u0131l\u0131rlar.","S\u0131cak romantik, ate\u015fli a\u015f\u0131klard\u0131r. Birlikte oldu\u011fu insan\u0131 ayaklar\u0131n\u0131 yerden keser. \u0130yi bir konu\u015fmac\u0131 oldu\u011fu i\xe7inde, g\xfczel a\u015fk s\xf6zleri s\xf6ylemekte \xfcstlerine yoktur.Bulunduklar\u0131 her ortamda sevgi krall\u0131klar\u0131n\u0131 ilan etmeye haz\u0131rd\u0131rlar.Kar\u015f\u0131 cins \xe7ekici ve toplum i\xe7inde kendilerini belli eden ki\u015filerdir.Cinsel a\xe7\u0131dan yo\u011fun ya\u015fad\u0131klar\u0131 duygular\u0131n\u0131 zor idare ederler.Aslan burcu ki\u015fisi partnerinden s\xfcrekli olumlu s\xf6zler duymaktan ho\u015fland\u0131klar\u0131 i\xe7in, en k\xfc\xe7\xfck bir ilgisizlik kar\u015f\u0131s\u0131nda t\xfcm dengelerini yitirirler. Ya\u015fam\u0131n karizmatik oyuncular\u0131d\u0131r. Sizi seven bir aslan erke\u011finden kurtulman\u0131z o kadar kolay olmayacakt\u0131r. O sizi se\xe7mi\u015f ise ona direnmeniz faydas\u0131zd\u0131r. Farkl\u0131 a\u015fklar\u0131n kahraman\u0131 olmaya e\u011filimlidirler. G\xfc\xe7l\xfc yap\u0131lar\u0131n\u0131 \xe7ocuklar\u0131nada yans\u0131tarak, onlar\u0131n m\xfckemmel olmas\u0131na \xe7al\u0131\u015f\u0131rlar. Aslan babas\u0131 iyi bir baba olman\u0131n t\xfcm \xf6zelliklerini ta\u015f\u0131r.","Ya\u015fama sade bakan do\u011fal ve samimi ki\u015filerdir. Onlarla ya\u015famak kolay de\u011fildir. \xc7\xfcnk\xfc disiplin duygusu i\xe7inde ya\u015fad\u0131klar\u0131 i\xe7in, birlikte olduklar\u0131 ki\u015filerin de ya\u015fam d\xfczenlerine kar\u0131\u015f\u0131rlar. Titiz ve sorgulay\u0131c\u0131d\u0131rlar. Ama\xe7s\u0131z ve beklentisiz ki\u015filer i\xe7in, zaman harcamaktan ho\u015flanmazlar. \u0130yi, bir aile reisi olduklar\u0131 s\xf6ylense de, bunu geciktirmek i\xe7in her t\xfcrl\xfc yolu denerler ve m\xfczmin bir bekar olmaktan kurtulamazlar. A\u015fk ili\u015fkileri zordur..S\xfcrekli denetleme duygular\u0131 y\xfcz\xfcnden partnerleriyle aralar\u0131nda s\xfcrekli sorun \xe7\u0131kar. Baba olduklar\u0131 zaman da bu duyguyu ge\xe7 tatman\u0131n keyifsizli\u011fini duyarlar. Onlar\u0131 en iyi ko\u015fullarda yeti\u015ftirmek i\xe7in ellerinden gelen her \u015feyi yaparlar . \xc7ocuklar\u0131 onlar\u0131n d\xfczenlerinden s\u0131k\u0131lsa bile en k\xfc\xe7\xfck sorunlar\u0131nda yanlar\u0131nda, babalar\u0131n\u0131 g\xf6rmekten keyif al\u0131rlar. Temkinlidirler ve hata yapmaktan \xe7ekinirler. M\xfckemmel olmak i\xe7in her t\xfcrl\xfc olanaklar\u0131 sonuna kadar savunur ve kullan\u0131rlar. Yapmak istedikleri ile hayalleri aras\u0131nda u\xe7urum yoktur. D\xfcnyay\u0131 kendi ki\u015fisel \xe7er\xe7evesinden g\xf6rmeye al\u0131\u015fk\u0131nd\u0131rlar. Duygusal istekleri ve arzular\u0131 \xf6n plandad\u0131r..Sabit d\xfc\u015f\xfcnme konusunda \u0131srarc\u0131 ve \xf6d\xfcn vermedikleri i\xe7in kendini zorlayacak konular ortaya \xe7\u0131kacakt\u0131r.","Bu adamdan pek \xe7ok \xf6\u011f\xfct alacaks\u0131n\u0131z. Sorunlar\u0131n\u0131z\u0131 b\xfcy\xfck bir zevkle dinleyecek ve ve size yard\u0131mc\u0131 olmak i\xe7in t\xfcm olanaklar\u0131n\u0131 kullanacakt\u0131r. Sizi o e\u015fsiz mant\u0131k g\xfcc\xfcn\xfcn etkisi alt\u0131na alacakt\u0131r. .\u0130kna kabiliyeti \xe7ok y\xfcksektir. Onunla birlikteyken, eski hayal k\u0131r\u0131kl\u0131klar\u0131n\u0131z\u0131 unutacaks\u0131n\u0131z. Size g\xfcl\xfcmsedi\u011fi anda, t\xfcm d\xfcnyan\u0131n ayaklar\u0131n\u0131z\u0131n alt\u0131nda oldu\u011funu hissedecek ve, sanki i\xe7inizden bir \u015feyler kopacak ve onun m\u0131knat\u0131s ki\u015fili\u011fi alt\u0131nda kendinizi \xe7ok farkl\u0131 d\xfcnyalar i\xe7inde bulacaks\u0131n\u0131z.Fakat Ven\xfcs\u2019\xfcn etkisinde olan bu erkekle, a\u015fk\u0131n\u0131z\u0131n sonsuza kadar s\xfcrece\u011fine inanacak kadar saf olmay\u0131n. O, sizi \xfczmeden ve k\u0131rmadan ka\xe7maya \xe7al\u0131\u015fabilir. \xc7\xfcnk\xfc, ili\u015fki kan kaybetmeden uzakla\u015fmak ve a\u015fk\u0131n\u0131 hep en g\xfczel an\u0131lar\u0131yla hat\u0131rlamak isterler. Bir terazi erke\u011fi y\xfcz ya\u015f\u0131na gelse bile,kar\u015f\u0131 cinse ilgisini kaybetmeyece\u011fi i\xe7in, \xe7evresi daima kalabal\u0131k ve kad\u0131nlarla \xe7evrili olacakt\u0131r. Zodyak\u0131n a\u015fk yapma sanat\u0131n\u0131 \xe7ok iyi bilen bu erke\u011fin kar\u015f\u0131nda hi\xe7bir kad\u0131n ilgisiz kalamayaca\u011f\u0131 muhakkak. Fakat i\u015fin ilgin\xe7 y\xf6n\xfc, ayr\u0131ld\u0131\u011f\u0131 sevgilileri ile dost ve arkada\u015f kalabilen, ender ki\u015filerdir. O, daima size sayg\u0131l\u0131 davranacak ve hi\xe7bir i\u015finize burnunu sokmayacakt\u0131r. Sizin t\xfcm s\u0131rlar\u0131n\u0131z\u0131 \xf6\u011frenmek gibi bir merak\u0131 yoktur. E\u011fer siz, b\xf6yle bir \u015feye yeltenirseniz, olduk\xe7a \u015fa\u015f\u0131racak ve g\xfcvenilmedi\u011fi duygusuna kap\u0131larak, size k\u0131r\u0131lacakt\u0131r. Terazi erke\u011fi, ayn\u0131 zamanda ya\u015fam\u0131n iyi bir yarg\u0131c\u0131d\u0131r. Onun inan\xe7lar\u0131na sayg\u0131 g\xf6stermek zorundas\u0131n\u0131z. \xc7\xfcnk\xfc, onlar i\xe7in yalan son derece i\u011fren\xe7 ve berbat bir olayd\u0131r. B\xf6yle bir duygu insan bedenini ve ruhunu kirleten bir \u015feydir. Anala\u015f\u0131lmad\u0131\u011f\u0131 zaman, ruhunun derinliklerinde gizli bir ac\u0131 ya\u015far. \u0130ncindi\u011fi zaman, nazik\xe7e sizden uzakla\u015f\u0131r.\u0130\u015fte t\xfcm bu \xf6zellikleri Terazi erke\u011fini farkl\u0131 k\u0131lar. Terazi erke\u011finin sosyal \xe7evresinde bol bol zeki ve ak\u0131ll\u0131 insanla olacakt\u0131r. Para konusunda eli s\u0131k\u0131 biri de\u011fildir. Dostlar\u0131n\u0131 en iyi \u015fekilde a\u011f\u0131rlamas\u0131n\u0131 bilir. Sanat ve entellekt\xfcellik ta\u015f\u0131yan konular ilgisini \xe7eker. Kalabal\u0131k ve kapal\u0131 yerlerden s\u0131k\u0131l\u0131r. Nezih ve kaliteli ortamlar\u0131 tercih ederler. Ruhsal dengelerini korumak i\xe7in ger\xe7ekten her \u015feyin uyum i\xe7inde olmas\u0131n\u0131 isterler. E\u011fer bir Terazi erke\u011fine a\u015f\u0131k olursan\u0131z, hemen vakit kaybetmeden gidin ve teklifinizi ona yap\u0131n. Sizi ger\xe7ekten be\u011fenmi\u015fse belki biraz naz yapacakt\u0131r. Fakat onu duygu karars\u0131zl\u0131klar\u0131ndan kurtarm\u0131\u015f olursunuz.. Sizi ger\xe7ekten be\u011feniyorsa, oda bu teklifiniz kar\u015f\u0131s\u0131nda rahatlayacakt\u0131r. \xc7\xfcnk\xfc bu zarif adam, a\u015fk konusunda ilk ad\u0131m\u0131 atacak kadar cesur de\u011fildir.","Derin bir duygu insan\u0131d\u0131rlar. Olaylara g\xfc\xe7l\xfc bir mant\u0131kla yakla\u015ft\u0131klar\u0131 i\xe7in, onlara her konuda g\xfcvenilir. Haf\u0131zalar\u0131 \xe7ok kuvvetlidir. Bir konuyu bir kez s\xf6ylemek yeterlidir. Hat\u0131rlat\u0131lmaktan nefret ederler. Asla y\xfczeysel bir ki\u015fi olamazlar. \xc7ocuklar\u0131 ile ileti\u015fim kurma konusunda, ketumdur. Onlardan g\xfc\xe7l\xfc bir ki\u015filik, ya\u015fama kar\u015f\u0131 dayan\u0131kl\u0131 olmalar\u0131n\u0131 bekler. Bir av t\xfcfe\u011fi, deri bir evrak \xe7antas\u0131, sert bir tra\u015f losyonu, g\xfczel bir ajanda. Deriden yap\u0131lm\u0131\u015f her t\xfcrl\xfc e\u015fyay\u0131 sever.","Yay burcu erke\u011fi entelekt\xfcel bir ki\u015fili\u011fe sahiptir. Kibar, son derece bilgili ve beyefendi bir erkektir. Hayat\u0131n\u0131n her alan\u0131nda bu \u015fekilde ya\u015famak ister. Asl\u0131nda bu durumun onlar i\xe7in \xe7ok \xf6nemlidir. Renkli, sevecen ve \u0131l\u0131ml\u0131d\u0131rlar. Cana yak\u0131n davran\u0131\u015flar\u0131 ile insanlar taraf\u0131ndan sevilen bir erkektir.","Ketum ve ciddi tav\u0131rlar\u0131 ile tan\u0131nan bir O\u011flak erke\u011finin yumu\u015fac\u0131k bir kalbi vard\u0131r.D\u0131\u015fardan g\xf6r\xfclen g\xf6r\xfcnt\xfcs\xfcn\xfcn alt\u0131nda \xe7ekingen ve duygusal bir ki\u015filik yatar. Akl\u0131 ba\u015f\u0131nda ve g\xfcvenilirdir.\xc7evresinde olup bitenleri, mant\u0131k \xe7er\xe7evesinde g\xf6zlemler. Sert bir mant\u0131kla yakla\u015f\u0131r ve sonu\xe7 her zaman do\u011frudur.Sakin ve sade ki\u015filerdir. Olaylar\u0131 abartmad\u0131klar\u0131 i\xe7in de baz\u0131 ki\u015filere renkli gelmeyebilirler. Aile kavramlar\u0131 \xe7ok \xf6nemlidir ve klasik bir anlay\u0131\u015flar\u0131 vard\u0131r Se\xe7tikleri e\u015f toplumsal ve geleneksel kurallara uygundur.\u0130yi bir babad\u0131rlar. Fakat so\u011fuk bir yakla\u015f\u0131m tarzlar\u0131 oldu\u011fu i\xe7in, daima \xe7ocuklar\u0131 ile aralar\u0131nda belli bir mesafe vard\u0131r. Onlar\u0131 ya\u015fama erken \xf6\u011fretmek i\xe7in \xe7abalarlar. . A\u015f\u0131r\u0131 bir \u015fekilde ku\u015fkuculard\u0131r, kolay inanmazlar ama inand\u0131klar\u0131 bir konuyu da sonuna kadar inatla savunurlar. \xc7al\u0131\u015fmalar\u0131nda sab\u0131r ve \xf6zenle \xe7al\u0131\u015f\u0131rlarken, g\xf6steri\u015ften uzak bir \u015fekilde i\u015flerini yaparlar","Zeki ve ak\u0131ll\u0131 ki\u015filerdir. Ya\u015fam\u0131 asla \u015fakaya almazlar. Olaylar\u0131 ak\u0131ll\u0131ca de\u011ferlendirdikleri i\xe7in anla\u015f\u0131lmas\u0131 zor ki\u015filerdir. Ne yapacaklar\u0131 ve nerede olacaklar\u0131n\u0131 kestirmeleri \xe7ok zordur. Hi\xe7 kimsenin d\xfc\u015f\xfcnmedi\u011fi olaylar\u0131 ya\u015fad\u0131klar\u0131 i\xe7in de, \xe7evreleriyle aralar\u0131nda g\xf6r\xfcnmez bir perde olu\u015ftururlar. Ya\u015fama pratik bakarlar. Bulunduklar\u0131 ortam\u0131n \xe7ok ilerisinde d\xfc\u015f\xfcn\xfcrler. \xc7evrelerinde be\u011fenilen ve sayg\u0131 duyulan ki\u015filerdir. Olaylar\u0131 gerekti\u011finden daha hafife al\u0131p, panik olmad\u0131klar\u0131 i\xe7in, politik yakla\u015f\u0131mlar geli\u015ftirerek, kestirmeden sonuca ula\u015f\u0131rlar. \u0130\u015fler iyi giderken, her \u015fey kontrolleri alt\u0131ndad\u0131r. Hayatlar\u0131nda \xe7eli\u015fkiye neden olan insanlar\u0131 g\xf6rmezlikten gelirler. Cesaret ve rahatl\u0131klar\u0131, bazen \xe7izmeyi a\u015fan sorunlara neden olur. Oyuncu yetenekleri \xe7ok geli\u015fmi\u015f oldu\u011fu i\xe7in, bazen toplum kar\u015f\u0131s\u0131nda da rol yapabilirler. \xd6\u011frenme kabiliyetleri \xe7ok y\xfcksektir.. M\xfckemmeliyet\xe7i yap\u0131lar\u0131ndan dolay\u0131, sert bir g\xf6r\xfcn\xfcm sergileseler de, zevkine ve konforuna d\xfc\u015fk\xfcnd\xfcrler Temkinli, sa\u011flamc\u0131 hatta ku\u015fkucu yap\u0131lar\u0131 onlar\u0131n ba\u015far\u0131ya gitmesindeki en b\xfcy\xfck etkendir.. Ayr\u0131nt\u0131lara \xe7ok \xf6nem verirler fakat, ya\u015fad\u0131\u011f\u0131 duygusal k\u0131r\u0131kl\u0131klar\u0131 belli etmezler. \xc7ocuklarla aras\u0131 daima iyidir ve onlara anlatacak \xe7ok \u015feyleri vard\u0131r. Elektroni\u011fe olan merak\u0131 y\xfcz\xfcnden \xe7evresini oyalayacak elinde doneleri \xe7ok fazlad\u0131r. Bazen garip bir yaln\u0131zl\u0131k duygusuna kap\u0131ld\u0131klar\u0131 i\xe7in , onu ho\u015f g\xf6rmek gerekir. Bu duygu ge\xe7ti\u011fi zaman, tekrar size d\xf6necektir. \u0130yi bir baba olmas\u0131na ra\u011fmen \xe7ocuklar\u0131n\u0131n ayaklar\u0131n\u0131 sa\u011flam basmas\u0131 i\xe7in, \xe7o\u011fu kez onlar\u0131 tek ba\u015flar\u0131na karar vermelerini ister.","O, yaln\u0131z bir adamd\u0131r.. Ne zaman, ne yapaca\u011f\u0131 hi\xe7 belli olmaz. Onu tan\u0131makla \u015fansl\u0131 m\u0131s\u0131n\u0131z, hi\xe7 bilinmez. Size elini uzat\u0131r ve kendi denizinde birlikte y\xfczmenizi teklif eder. Oysa, her \u015fey size yapanc\u0131d\u0131r. \u015ea\u015fk\u0131nl\u0131kla ona e\u015flik etmeye \xe7al\u0131\u015f\u0131rs\u0131n\u0131z. Sizin s\u0131n\u0131rlar\u0131n\u0131z\u0131 bilmez. Hep kendi sular\u0131nda y\xfczer. Y\xfczmeyi onun kadar bilmiyorsan\u0131z, al\u0131r ba\u015f\u0131n\u0131 \xe7eker gider. Ona belki de asla bir daha kar\u015f\u0131la\u015fma \u015fans\u0131n\u0131z olamayacak ve ak\u0131l\u0131n\u0131zda daima g\xf6zya\u015flar\u0131n\u0131 silen bir Bal\u0131k hat\u0131rlayacaks\u0131n\u0131z. Bir g\xfcn bitti\u011fine sizde inanmayacaks\u0131n\u0131z. Belki de y\u0131llar sonra, yan\u0131n\u0131zda size e\u015flik edecek bir Bal\u0131k erke\u011fi olacakt\u0131r. Hangisinin olaca\u011f\u0131n siz karar vereceksiniz. Kendi de\u011fer yarg\u0131lar\u0131na g\xf6re ya\u015famaktan yanad\u0131r. \xc7evreye farkl\u0131 gelen yap\u0131s\u0131yla hep bir giz olarak an\u0131lacakt\u0131r. Kendisini g\xfcven i\xe7inde hissetmesi i\xe7in, s\xfcrekli korunmaya ihtiyac\u0131 vard\u0131r. Bu \u015fartlar\u0131 ona sa\u011flarsan\u0131z, \xf6m\xfcr boyu size yaslanacak ve mutlu olacakt\u0131r. Kendisinden uzakla\u015ft\u0131\u011f\u0131n\u0131z\u0131 fark ederse, sessizce ba\u015fka g\xfcvenler arayacakt\u0131r."]),t.s)
